INSERT INTO `announcement` (`id`, `title`, `message`, `created_at`) VALUES
(5, 'Eid Holidays', '<p>Dear Team,</p><p>It is to inform you that office will remain off on<b><i> Monday 12th September 2016 till Wednesday 14th September 2016.&nbsp;</i></b></p><p>On behalf of every one i would wish you and your family a very happy <b>Eid</b>.</p><p>Best regards,</p><p>Board 4Slash&nbsp;</p>', '2016-09-07 19:09:29'),
(7, 'Assalam U Alikum ', '<p>Sprout Has Been Finalized , Its a Pleasure for us to build it .&nbsp;</p><p>Thank you ,</p><p>Your Sincerely</p>', '2019-12-09 12:53:05'),
(8, 'COVID VACINATION ', '<p>\r\n\r\n</p><div><p><strong>Getting back to Normal</strong></p><p><strong>If we use all the tools we have, we stand the best chance of getting our families, communities, schools and workplaces back to normal sooner.</strong></p><p>1. Get Vaccinated</p><p>2. Wear a mask</p><p>3.&nbsp; Wash hands often.</p><p><strong><br></strong></p><p><strong>Potential benefits to employees:</strong><br></p></div><div><div><div><ul><li>Keep the workforce healthy by preventing employees from getting COVID-19</li><li>Reduce absences due to illness</li><li>Improve productivity</li><li>Improve morale</li></ul></div></div></div><p></p>', '2021-06-12 06:57:41');
